Location/Directions

Rocheport is located half-way between Saint Louis and Kansas City on I-70, about 7 miles west of Columbia. The ride begins and ends at Les Bourgeois Vineyards and Winery, 14020 W. Highway BB, Rocheport, MO 65279. &#x28;Google Map and Directions&#x29;

From St. Louis metro area &#x28;2 hours&#x29;

    I-70 West to Rocheport &#x28;about 7 miles west of Columbia&#x29;
    Take Exit 115-Hwy BB North &#x28;right&#x29; onto Hwy BB towards Rocheport
    Drive about 1 mile north to Les Bourgeois Vineyards on your left
    &#x28;Watch for a prominent Les Bourgeois sign and vineyards on your left.&#x29;

From the KC metro area &#x28;1 hours 30 minutes&#x29;

    I-70 East to Rocheport
    Take Exit 115-Hwy BB North &#x28;right&#x29; onto Hwy BB towards Rocheport
    Drive about 1 mile north to Les Bourgeois Vineyards on your left
    &#x28;Watch for a prominent Les Bourgeois sign and vineyards on your left.&#x29;

From Springfield &#x28;3 hours 20 minutes&#x29;

    I-44 East to Lebanon
    At Lebanon take exit 129 to Hwy 5 north
    Continue north on Hwy 5 to Camdenton
    At Camdenton, take Hwy 54 north to Jefferson City
    Continue on Hwy 54 through Jefferson City and across the Missouri River Bridge.
    Then take Hwy 63 North to Columbia
    At Columbia, take I-70 West to Rocheport
    Take Exit 115-Hwy BB North &#x28;right&#x29; onto Hwy BB towards Rocheport
    Drive about 1 mile north to Les Bourgeois Vineyards on your left
    &#x28;Watch for a prominent Les Bourgeois sign and vineyards on your left.&#x29;
